import '../scripts_css/home.css';
import Hero from '../staticImgs/image.png';
export default function Home() {
  return (
    <div>
      <BouncyBalls />
      <main className="home">
        <div>
        <h1>"Find Your Sound: Tailored for Your Lifestyle"</h1>

        <img src={Hero} alt="AudioHero" className='Hero' />
        </div>
        <Slider />
      </main>
    </div>
  );
}
